public static double[] bracket(UnivariateRealFunction function,
        double initial, double lowerBound, double upperBound, 
        int maximumIterations) throws ConvergenceException, 
        FunctionEvaluationException {

    if (function == null) {
        throw new IllegalArgumentException("function is null");
    }
    if (maximumIterations <= 0)  {
        throw new IllegalArgumentException("bad value for maximum iterations number: " + maximumIterations);
    }
    if (initial < lowerBound || initial > upperBound || lowerBound >= upperBound) {
        throw new IllegalArgumentException("invalid bracketing parameters:  lower bound=" + lowerBound + ",  initial=" + initial + ", upper bound=" + upperBound);
    }
    double a = initial - 1.0;
    double b = initial + 1.0;
    double fa;
    double fb;
    int numIterations = 0 ;

    do {
        fa = function.value(a);
        fb = function.value(b);
        numIterations++ ;
        if (fa * fb <= 0.0) {
            break;
        }
        if (numIterations >= maximumIterations) {
            throw new ConvergenceException("number of iterations=" + numIterations + ", maximum iterations=" + maximumIterations + ", initial=" + initial +
                    ", lower bound=" + lowerBound + ", upper bound=" + upperBound + ", final a value=" + a + ", final b value=" + b + ", f(a)=" + fa + ", f(b)=" + fb);
        }
        if (a <= lowerBound && b >= upperBound) {
            throw new ConvergenceException("number of iterations=" + numIterations + ", maximum iterations=" + maximumIterations + ", initial=" + initial +
                    ", lower bound=" + lowerBound + ", upper bound=" + upperBound + ", final a value=" + a + ", final b value=" + b + ", f(a)=" + fa + ", f(b)=" + fb);
        }
        if (a > lowerBound) {
            a = Math.max(a - 1.0, lowerBound);
        }
        if (b < upperBound) {
            b = Math.min(b + 1.0, upperBound);
        }
    } while (true);

    return new double[]{a, b};
}

public static double[] bracket(UnivariateRealFunction function,
        double initial, double lowerBound, double upperBound, 
        int maximumIterations) throws ConvergenceException, 
        FunctionEvaluationException {

    if (function == null) {
        throw new IllegalArgumentException("function is null");
    }
    if (maximumIterations <= 0)  {
        throw new IllegalArgumentException("bad value for maximum iterations number: " + maximumIterations);
    }
    if (initial < lowerBound || initial > upperBound || lowerBound >= upperBound) {
        throw new IllegalArgumentException("invalid bracketing parameters:  lower bound=" + lowerBound + ",  initial=" + initial + ", upper bound=" + upperBound);
    }
    double a = initial - 1.0;
    double b = initial + 1.0;
    double fa;
    double fb;
    int numIterations = 0 ;

    do {
        fa = function.value(a);
        fb = function.value(b);
        numIterations++ ;

        if (fa * fb <= 0.0) {
            break;
        }

        if (a <= lowerBound && b >= upperBound) {
            throw new ConvergenceException("ConvergenceException");
        }

        if (numIterations >= maximumIterations) {
            throw new ConvergenceException("ConvergenceException");
        }

        if (a > lowerBound) {
            a = Math.max(a - 1.0, lowerBound);
        }

        if (b < upperBound) {
            b = Math.min(b + 1.0, upperBound);
        }
    } while (true);

    return new double[]{a, b};
}
